import React from "react";
import { Navbar, Nav, NavDropdown, Button } from "react-bootstrap";
// import "./NavbarHeader.css"

const NavbarHeader = () => {
  return (
    <div id="navbarHeader"> 
      <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
      <Button variant="outline-secondary"><i className="bi bi-justify"></i></Button>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="me-auto">
          <Nav.Link href="/clients">Clients</Nav.Link>
          <Nav.Link href="/projects">Projects</Nav.Link>
          <Nav.Link href="/employees">Employees</Nav.Link>
        </Nav>
        <Nav>
          <Nav.Link href=""><i class="bi bi-gear"></i> Admin Options</Nav.Link>
          <NavDropdown title="User Name" id="collapsible-nav-dropdown">
            <NavDropdown.Item href="">Action1</NavDropdown.Item>
            <NavDropdown.Item href="">Action2</NavDropdown.Item>
            <NavDropdown.Item href="">Action3</NavDropdown.Item>
            <NavDropdown.Divider />
            <NavDropdown.Item href="">Action4</NavDropdown.Item>
          </NavDropdown>
        </Nav>
        </Navbar.Collapse>
      </Navbar>
    </div>
  );
};

export default NavbarHeader;
